import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function createNotes(notess){
    return(
        <Note
            key = {notess.key}
            title = {notess.title}
            content = {notess.content}
        />
    )
}

function App(){
    return (
        <div>
            <Header />
            {notes.map(createNotes)}
            <Footer />
        </div>
    );
}

export default App;
